First, ensure you have Rust installed on your system. You can download it from [https://www.rust-lang.org/tools/install](https://www.rust-lang.org/tools/install).

### Step 1: Create a New Rust Project

Open a terminal or command prompt and run:

```bash
cargo new elevenlabs_tts
cd elevenlabs_tts
```

