We'll need to add dependencies for HTTP requests (to interact with the ElevenLabs API), clipboard access, and possibly for playing audio. Edit your `Cargo.toml` to include the following dependencies:

```toml
[dependencies]
reqwest = "0.11"
tokio = { version = "1", features = ["full"] }
clipboard = "0.5.0"
rodio = "0.16.0"
```

- `reqwest` and `tokio` are for making asynchronous HTTP requests.
- `clipboard` is for accessing the system clipboard.
