I'm trying to sort an array of strings in a case-sensitive manner. By default, JavaScript's sort() function is case-insensitive. How can I achieve case-sensitive sorting in JavaScript?
To achieve case-sensitive sorting in JavaScript, you can use the `localeCompare()` method with the `en` locale and the `sensitivity` option set to `'case'`. Here's an example:
```javascript
const arr = ['Zebra', 'apple', 'Banana', 'cat'];
arr.sort((a, b) => a.localeCompare(b, 'en', { sensitivity: 'case' }));
console.log(arr); // Output: ['Banana', 'Zebra', 'apple', 'cat']
```
Alternatively, you can use the `charCodeAt()` method to compare the ASCII values of the characters:
```javascript
const arr = ['Zebra', 'apple', 'Banana', 'cat'];
arr.sort((a, b) => {
  for (let i = 0; i < Math.min(a.length, b.length); i++) {
    if (a.charCodeAt(i) !== b.charCodeAt(i)) {
      return a.charCodeAt(i) - b.charCodeAt(i);
    }
  }
  return a.length - b.length;
});
console.log(arr); // Output: ['Banana', 'Zebra', 'apple', 'cat']
```
