### Step-by-step analysis of the problem:
1. **Current Implementation**: The current implementation of the `Tooltip` component uses the `useState` hook to manage its own state, which means each `Tooltip` component is isolated from the others.
2. **Requirement**: The requirement is to close the previously opened tooltip when a new one is opened. This implies that there needs to be a way for the `Tooltip` components to communicate with each other.
3. **Solution Approach**: To achieve this, we can use React Context to share state between the `Tooltip` components. We will create a context that manages the state of the tooltips and provides a way to update this state.

### Fixed solution:
```jsx
// TooltipContext.js
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const handleOpenTooltip = (id) => {
    setOpenTooltip(id);
  };

  const handleCloseTooltip = () => {
    setOpenTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, handleOpenTooltip, handleCloseTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
